  state = {
  };

  render() {
    return (
        <div class="container-fluid w-87">
            <div class="row">

                <div class="col-md-5 border bg-dark text-white">
                  <div class="row">
                      <TweetComponent />
                      <FeedsComponent />
                  </div>
                </div>
                <div class="col-md-3 border bg-dark text-white">Right Sidebar</div>
            </div>
        </div>
    );
  }
}

export default MainPage;
